text:
sabias que?!
todos los equipos son de última generación y chequeados detalladamente en cada salto;
la alta tecnología de los paracaídas es percibida en cada detalle como en uno de los componentes llamado daa – dispositivo de accionamiento automático. este dispositivo fue desarrollado por la nasa y recreado para el uso deportivo;
el equipamiento que prende el pasajero al instructor está compuesto por cuatro ganchos, y cada uno de ellos soporta hasta dos toneladas;
@skydivefoz utiliza solamente el modelo sigma, considerado el mejor y más seguro paracaídas para la realización de saltos con pasajeros;
todos los equipamientos de salto doble utilizados en @skydivefoz son fabricados por la upt – united parachute technologies.
.
.
